import './benefits.scss'

function Benefits() {
    return (
        <div className="benefits">
            <h1 className='ttl'>Преимущества использования DataPilot c КриптоПро</h1>
            <p>При работе ЭЦП с помощью КриптоПро использование DataPilot позволяет эффективно решать<br /> следующие задачи:</p>

            <ul>
                <li>Необходимость отслеживать актуальность ключей ЭЦП;</li>
                <li>Несмотря на кажущуюся простоту библиотеки, существует множество не документированных нюансов. Часто это приводит к рискам и срывам сроков.</li>
                <li></li>
            </ul>
        </div>
    );
}

export default Benefits;
